var app=angular.module("twitterApp",[]);app.controller("twitterController",["$scope","$http",function(a,b){a.noun="",a.adjective="",a.nameArray=[],a.nameMaker=function(){console.log("nameMaker","running"),a.getNoun()},a.getNoun=function(){b.get("/noun").then(function(b){console.log("Noun",b),a.noun=b.data,a.getAdj(b.data)})},a.getAdj=function(c){b.get("/adjective").then(function(b){console.log("Adjective",b),a.adjective=b.data,a.makeName(b.data,c)})},a.makeName=function(b,c){a.nameArray.push({name:b+c})};for(var c=0;10>c;c++)a.nameMaker()}]);